// StoneProducts.js
import React from 'react';

const stoneProductsData = [
  {
    image: 'granite.jpg',
    title: 'Granites',
    description: 'Description for Stone Product 1.',
  },
  {
    image: 'marbles.jpg',
    title: 'Marbles',
    description: 'Description for Stone Product 2.',
  },
  {
    image: 'mosaic.jpg',
    title: 'Mosaic',
    description: 'Description for Stone Product 3.',
  },
  {
    image: 'fireplace.jpg',
    title: 'Fireplace',
    description: 'Description for Stone Product 4.',
  },
  {
    image: 'solidwork.jpg',
    title: 'Solid Work',
    description: 'Description for Stone Product 5.',
  },
  {
    image: 'bowl.jpg',
    title: 'Bowl',
    description: 'Description for Stone Product 6.',
  },
  {
    image: 'tabletop.jpg',
    title: 'Table Top',
    description: 'Description for Stone Product 7.',
  },
  {
    image: 'floorborder.jpg',
    title: 'Floor Border',
    description: 'Description for Stone Product 8.',
  },
  // Add more stone products as needed
];

function StoneProducts() {
  return (
    <section className="stone-products">
      <div className="container">
        <div className="row">
          {stoneProductsData.map((product, index) => (
            <div key={index} className="col-md-3 mb-4">
              <a href={`/details/${product.title}`} target="_blank">
                <img src={product.image} alt={product.title} className="stone-img" />
              </a>
              <h2>{product.title}</h2>
              <p>{product.description}</p>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}

export default StoneProducts;
